import HeroSection from "../components/HeroSection";

function Rsvp() {
  return (
    <>
      <HeroSection
        title={"RSVP"}
        description={"Tụi mình đang build page mọi người chờ tí nhé :)"}
      />
    </>
  );
}

export default Rsvp;
